import React from "react";
import board from "./../images/board.png"



function Info()
{
    return(
        <div className="Info">
            <img src={board} onClick={this.clicked} />
        </div>
    );
}

function clicked()
{
    return(
        <div className="Clicked">
            It was clicked!!!
        </div>
    );
}

export default Info;
